import {useEffect, useState} from 'react'

const Settings = () => {

  const [options, setOptions] = useState(null)

  useEffect(()=>{
    fetch('https://opentdb.com/api_category.php')
    .then((resp) => resp.json())
    .then((data) => {
      setOptions(data.trivia_categories)
    })
  }, [setOptions])

  return (
    <div></div>
  )
}

export default Settings
